import React, { Component } from "react";
import "../css/header.css";

export class Header extends Component {
  render() {
    return (
      <div className="header">
        <h1 class="title"> This is Header </h1>
        <li>Logo</li>
        <li>Logo</li>
      </div>
    );
  }
}

export default Header;
